import React from 'react';
import './UserDashboard.css';
import { useNavigate } from 'react-router-dom';

const UserDashboard = () => {
    const navigate = useNavigate();
    const username = localStorage.getItem('username'); 

    const handleLogout = () => {
        console.log('Logging out...');
        navigate('/login', { replace: true });

    };

    const navigateToUserBookList = () => {
        navigate('/userBookList'); 
    };
    const navigateToBookingList = () => {
        navigate('/bookingList');
    };
    const navigateToReservationList = () => {
        navigate('/reservationList');
    };
    return (
        <div className="user-main-content">
            <div className="user-header">
                <h1>Welcome, {username || 'User'}</h1>
                <button className="user-logout-button" onClick={handleLogout}>Logout</button>
            </div>

            <div className="user-section">
                <h2>Self-Service</h2>
                <button className="user-button" onClick={navigateToUserBookList}>Checkout Resources</button>
            </div>

            <div className="user-section">
                <h2>Renewals and Reservations</h2>
                <button className="user-button" onClick={navigateToBookingList}> My Bookings</button>
                <button className="user-button" onClick={navigateToReservationList}> My Reservations</button>
            </div>
        </div>
    );
};

export default UserDashboard;
